import React, { Component } from 'react'
// import Approuter from '../router/AppRouter'
import style from './box.model.less'
import Usestate from './Hook/useState'
class Box extends Component {
    render() {
        return (
            <div className={style.box}>
                {/* < Approuter></ Approuter> */}
                <Usestate></Usestate>
            </div>

        )
    }
}
export default Box
